function Pre101046UI:BringBackTheOldUI()
    for _, v in ipairs(redirectTextures) do
        RedirectTexture(v[1], v[2])
    end
end

function Pre101046UI:ClearRedirections()
    for _, v in ipairs(redirectTextures) do
        RedirectTexture(v[1], "")
    end
end

function Pre101046UI:ToggleUI()
    if self.uiEnabled then
        -- UI is currently enabled, so clear redirections
        self:ClearRedirections()
        self.uiEnabled = false
        d("Pre101046UI: Old UI has been disabled.")
    else
        -- UI is currently disabled, bring back old UI
        self:BringBackTheOldUI()
        self.uiEnabled = true
        d("Pre101046UI: Old UI has been enabled.")
    end
end

function Pre101046UI:Initialize()
    if self.isInitialized then
        return
    end

    self.uiEnabled = true
    self:BringBackTheOldUI()

    -- Register slash command
    SLASH_COMMANDS["/oldui"] = function ()
        self:ToggleUI()
    end

    self.isInitialized = true
end

function Pre101046UI:OnPlayerActivated()
    eventManager:UnregisterForEvent(self.AddonName, EVENT_PLAYER_ACTIVATED)
    self:Initialize()
end

function Pre101046UI:OnAddOnLoaded(eventId, addonName)
    if addonName ~= self.AddonName then
        return
    end

    eventManager:UnregisterForEvent(self.AddonName, EVENT_ADD_ON_LOADED)
    eventManager:RegisterForEvent(self.AddonName, EVENT_PLAYER_ACTIVATED,
                                  function ()
                                      self:OnPlayerActivated()
                                  end)
end

return eventManager:RegisterForEvent(Pre101046UI.AddonName, EVENT_ADD_ON_LOADED,
                                     function (...)
                                         Pre101046UI:OnAddOnLoaded(...)
                                     end)
